import React, { useState } from "react";
import "./Projetos.css";
import TextField from '@mui/material/TextField';
import axios from "axios";
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';
import { useNavigate } from 'react-router-dom';
import Snackbar from '@mui/material/Snackbar';
import Alert from '@mui/material/Alert';
import { createTheme, ThemeProvider } from '@mui/material/styles';


const Projetos = () => {
    const navigate = useNavigate();
  
    const [state, setState] = useState({
        login: '',
        senha: '',
        nome: '',
        cpf: '',
        inscricao: '',
        estadoDeEmissao: '',
        filiacao: '',
        dataDeNascimento: ''
    });
  
    const theme = createTheme({
        components: {
          MuiTextField: {
            styleOverrides: {
              root: {
                '& .MuiInputBase-root': {
                  height: '30px', // Altura desejada para o TextField
                  '& input': {
                    padding: '0 14px', // Padding interno
                    height: '30px', // Altura do input
                  },
                },
              },
            },
          },
        },
      });

    const [snackbarOpen, setSnackbarOpen] = useState(false);
    const [snackbarMessage, setSnackbarMessage] = useState('');
    const [snackbarSeverity, setSnackbarSeverity] = useState('success'); // Pode ser 'success' ou 'error'

    const handleChange = (campo) => (event) => {
      setState({ ...state, [campo]: event.target.value });
    }
          
    const salvar = async () => {
        axios.post('http://localhost:8080/api/advogado', {
          login: state.login,
          senha: state.senha,
          nome: state.nome,
          cpf: state.cpf,
          inscricao: state.inscricao,
          estadoDeEmissao: state.estadoDeEmissao,
          filiacao: state.filiacao,
          dataDeNascimento: state.dataDeNascimento
         }).then(response => {
           console.log(response);
           setSnackbarMessage('Cadastro realizado com sucesso!');
           setSnackbarSeverity('success');
           setSnackbarOpen(true);
           setState({
            login: '',
            senha: '',
            nome: '',
            cpf: '',
            inscricao: '',
            estadoDeEmissao: '',
            filiacao: '',
            dataDeNascimento: ''
          });
         }).catch(error => {
           console.log(error.response);
           setSnackbarMessage('Erro ao realizar o cadastro!');
           setSnackbarSeverity('error');
           setSnackbarOpen(true);
         });
         console.log('request finished');
    }
   
    const cancel = () => {
        console.log('cancel');
    }

    const goToAssociado = () => {
        navigate("/sessao/createAssociado");
    }

    const goToCliente = () => {
        navigate("/sessao/createCliente");
    }

    const handleCloseSnackbar = () => {
        setSnackbarOpen(false);
    };

    return (
        <div className="container">
            <div className="row">
                <div className="col-lg-12">
                    <div className="bs-component">
                        <div style={{marginTop: '80px'}}>
                                <ButtonGroup style={{height:'30px'}} variant="contained" aria-label="Basic button group">
                                <Button style={{ backgroundColor: 'grey', fontSize: 10, width: 120 }} onClick={goToCliente}>Processos</Button>
                                <Button style={{ backgroundColor: 'white', color: 'grey' , fontSize: 10, width: 120 }}>Status</Button>
                                <Button style={{ backgroundColor: 'white', color: 'grey' , fontSize: 10, alignItems: 'center', width: 120  }} onClick={goToAssociado}>Anexos</Button>
                                </ButtonGroup>
                                <div style={{width: 1100, height: 470, background: 'white', border: '2px #838383 solid'}}>
                                    
                                    <div style={{marginTop: '25px', marginLeft: '30px'}}>
                                    <div style={{width: 80, height: 40, color: '#838383', fontSize: 12, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>TITULO</div>
                                    <ThemeProvider theme={theme}>
                                    <TextField
                                    hiddenLabel
                                    id="filled-hidden-label-small"
                                    defaultValue=""
                                    variant="filled"
                                    size="small"
                                    sx={{
                                        marginTop: '-15px',
                                        width: '250px',
                                        '& .MuiInputBase-root': {
                                          height: '30px',
                                          padding: '0 14px',
                                          '& input': {
                                            height: '30px',
                                            padding: '0',
                                          },
                                        },
                                      }}
                                    value={state.login}
                                    onChange={handleChange('login')} 
                                    />
                                    </ThemeProvider>
                                    </div>
                        </div>
                        </div>
                    </div>
                </div>
            </div>
            <Snackbar open={snackbarOpen} autoHideDuration={6000} onClose={handleCloseSnackbar}>
            <Alert onClose={handleCloseSnackbar} severity={snackbarSeverity} sx={{ width: '100%' }}>
                {snackbarMessage}
            </Alert>
            </Snackbar>
        </div>
    );
}

export default Projetos;
